import '../css/Header.css';

class Header {
    render (props) {
        return (
            <>
                <span class="about-details-span">{props.title}</span>
                <div class="hr m-3"></div>Hello
                <p class="mt-3 px-5">{props.description}</p>
            </>    
        );
    }
}

export default Header;
